      "lineNumber": 253372,
      "originalJapaneseLine": "\t\t屋敷に入るとメイド達が現れる",
      "translatedEnglishLine": "\t\tWhen you enter the mansion, the maids appear."
    },
    {
      "lineNumber": 253373,
      "originalJapaneseLine": "\t\t招かれざる客には死を",
      "translatedEnglishLine": "\t\tDeath to uninvited guests."
    },
    {
      "lineNumber": 253374,
      "originalJapaneseLine": "\t\t屋敷の中はモンスターがいっぱい",
      "translatedEnglishLine": "\t\tThe mansion is full of monsters."
    },
    {
      "lineNumber": 253375,
      "originalJapaneseLine": "\t\tる壺から発生しているかも",
      "translatedEnglishLine": "\t\tThey might be emerging from the cursed urn."
    },
    {
      "lineNumber": 253376,
      "originalJapaneseLine": "\t\t呪いの結界で迷わされていた",
      "translatedEnglishLine": "\t\tWe were being confused by a cursed barrier."
    },
    {
      "lineNumber": 253377,
      "originalJapaneseLine": "\t\tパステルが一部を解除する",
      "translatedEnglishLine": "\t\tPastel dispels a part of it."
    },
    {
      "lineNumber": 253378,
      "originalJapaneseLine": "結界の一部をパステルが解除する",
      "translatedEnglishLine": "Pastel dispels a part of the barrier."
    },
    {
      "lineNumber": 253379,
      "originalJapaneseLine": "２５％済み",
      "translatedEnglishLine": "25% completed."
    },
    {
      "lineNumber": 253380,
      "originalJapaneseLine": "結界の一部をパステルが解除する",
      "translatedEnglishLine": "Pastel dispels a part of the barrier."
    },
    {
      "lineNumber": 253381,
      "originalJapaneseLine": "５０％済み",
      "translatedEnglishLine": "50% completed."
    },
    {
      "lineNumber": 253382,
      "originalJapaneseLine": "ケッセルリンクはカラーの魔人",
      "translatedEnglishLine": "Kesselrink is a color demon."
    },
    {
      "lineNumber": 253383,
      "originalJapaneseLine": "結界の一部をパステルが解除する",
      "translatedEnglishLine": "Pastel dispels a part of the barrier."
    },
    {
      "lineNumber": 253384,
      "originalJapaneseLine": "７５％済み",
      "translatedEnglishLine": "75% completed."
    },
    {
      "lineNumber": 253385,
      "originalJapaneseLine": "結界の一部をパステルが解除する",
      "translatedEnglishLine": "Pastel dispels a part of the barrier."
    },
    {
      "lineNumber": 253386,
      "originalJapaneseLine": "これで１００％済み",
      "translatedEnglishLine": "This makes it 100% completed."
    },
    {
      "lineNumber": 253387,
      "originalJapaneseLine": "\t\t石像が動き出し襲ってくる",
      "translatedEnglishLine": "\t\tThe statues start moving and attack."
    },
    {
      "lineNumber": 253388,
      "originalJapaneseLine": "\t\t戦闘開始",
      "translatedEnglishLine": "\t\tBattle start."
    },
    {
      "lineNumber": 253389,
      "originalJapaneseLine": "\t\tまた石像が並んでいる廊下",
      "translatedEnglishLine": "\t\tA corridor lined with statues again."
    },
    {
      "lineNumber": 253390,
      "originalJapaneseLine": "\t\t戦闘開始",
      "translatedEnglishLine": "\t\tBattle start."
    },
    {
      "lineNumber": 253391,
      "originalJapaneseLine": "\t\t使徒バーバラ、使徒パレロアが現れる",
      "translatedEnglishLine": "\t\tApostle Barbara and Apostle Paleroa appear."
    },
    {
      "lineNumber": 253392,
      "originalJapaneseLine": "\t\t戦闘開始",
      "translatedEnglishLine": "\t\tBattle start."
    },
    {
      "lineNumber": 253393,
      "originalJapaneseLine": "\t\tメイド使徒を倒した",
      "translatedEnglishLine": "\t\tDefeated the maid apostles."
    },
    {
      "lineNumber": 253394,
      "originalJapaneseLine": "\t\tしかし、逃げられた",
      "translatedEnglishLine": "\t\tHowever, they escaped."
    },
    {
      "lineNumber": 253395,
      "originalJapaneseLine": "\t\t使徒エルシール、使徒シャロン、",
      "translatedEnglishLine": "\t\tApostle Elsea, Apostle Sharon,"
    },
    {
      "lineNumber": 253396,
      "originalJapaneseLine": "\t\t使徒加奈代が現れた",
      "translatedEnglishLine": "\t\tand Apostle Kanayo appeared."
    },
    {
      "lineNumber": 253397,
      "originalJapaneseLine": "\t\t戦闘開始",
      "translatedEnglishLine": "\t\tBattle start."
    },
    {
      "lineNumber": 253398,
      "originalJapaneseLine": "\t\tメイド使徒を倒した",
      "translatedEnglishLine": "\t\tDefeated the maid apostles."
    },
    {
      "lineNumber": 253399,
      "originalJapaneseLine": "\t\tしかし、逃げられた",
      "translatedEnglishLine": "\t\tHowever, they escaped."
    },
    {
      "lineNumber": 253400,
      "originalJapaneseLine": "\t\t使徒アルカリア、使徒リリムが現れた",
      "translatedEnglishLine": "\t\tApostle Arcaria and Apostle Lilim appeared."
    },
    {
      "lineNumber": 253401,
      "originalJapaneseLine": "\t\t戦闘開始",
      "translatedEnglishLine": "\t\tBattle start."
    },
    {
      "lineNumber": 253402,
      "originalJapaneseLine": "\t\t倒したメイド二人を別室に連れ込んで",
      "translatedEnglishLine": "\t\tTook the two defeated maids to a separate room."
    },
    {
      "lineNumber": 253403,
      "originalJapaneseLine": "\t\tレイプ",
      "translatedEnglishLine": "\t\t(Rape)"
    },
    {
      "lineNumber": 253404,
      "originalJapaneseLine": "\t\tそうこうしているうちに",
      "translatedEnglishLine": "\t\tWhile doing that,"
    },
    {
      "lineNumber": 253405,
      "originalJapaneseLine": "\t\t夕方になった",
      "translatedEnglishLine": "\t\tEvening came."
    },
    {
      "lineNumber": 253406,
      "originalJapaneseLine": "\t\t地下室、棺の部屋に到着する",
      "translatedEnglishLine": "\t\tArrived at the basement, the coffin room."
    },
    {
      "lineNumber": 253407,
      "originalJapaneseLine": "\t\tガーディアンが襲ってきた",
      "translatedEnglishLine": "\t\tGuardians attacked."
    },
    {
      "lineNumber": 253408,
      "originalJapaneseLine": "\t\t戦闘開始",
      "translatedEnglishLine": "\t\tBattle start."
    },
    {
      "lineNumber": 253409,
      "originalJapaneseLine": "\t\t棺を開けると魔人ケッセルリンクが眠っていた",
      "translatedEnglishLine": "\t\tOpened the coffin and found the demon Kesselrink sleeping."
    },
    {
      "lineNumber": 253410,
      "originalJapaneseLine": "\t\t殺す前に最期のメイドを犯す",
      "translatedEnglishLine": "\t\tViolated the last maid before killing him."
    },
    {
      "lineNumber": 253411,
      "originalJapaneseLine": "\t\tケッセルリンクが目を覚ました",
      "translatedEnglishLine": "\t\tKesselrink woke up."
    },
    {
      "lineNumber": 253412,
      "originalJapaneseLine": "\t\t圧倒的、勝てない",
      "translatedEnglishLine": "\t\tOverwhelming, unbeatable."
    },
    {
      "lineNumber": 253413,
      "originalJapaneseLine": "\t\tランス達は脱出した",
      "translatedEnglishLine": "\t\tRance and the others escaped."
    },
    {
      "lineNumber": 253414,
      "originalJapaneseLine": "\t\tラングバウに逃げ戻った",
      "translatedEnglishLine": "\t\tThey fled back to Langbau."
    },
    {
      "lineNumber": 253415,
      "originalJapaneseLine": "\t\t数日が過ぎた",
      "translatedEnglishLine": "\t\tSeveral days passed."
    },
    {
      "lineNumber": 253416,
      "originalJapaneseLine": "\t\tアミトスもチュパ病に感染",
      "translatedEnglishLine": "\t\tAmitos also contracted the 'Chupa' disease."
    },
    {
      "lineNumber": 253417,
      "originalJapaneseLine": "\t\tランス達は追い詰められていた",
      "translatedEnglishLine": "\t\tRance and the others were being cornered."
    },
    {
      "lineNumber": 253418,
      "originalJapaneseLine": "\t\tシィルとシーラを相手にやけ酒中",
      "translatedEnglishLine": "\t\tDrinking in despair while dealing with Siil and Sheila."
    },
    {
      "lineNumber": 253419,
      "originalJapaneseLine": "\t\tケッセルリンクが現れシィルとシーラだけを連れ去る",
      "translatedEnglishLine": "\t\tKesselrink appears and takes only Siil and Sheila away."
    },
    {
      "lineNumber": 253420,
      "originalJapaneseLine": "\t\tシィルとシーラ奪還の為に戦いに向かう",
      "translatedEnglishLine": "\t\tHead off to battle to rescue Siil and Sheila."
    },
    {
      "lineNumber": 253421,
      "originalJapaneseLine": "\t\tトランシルバニアの森へ進軍",
      "translatedEnglishLine": "\t\tAdvance into the forest of Transylvania."
    },
    {
      "lineNumber": 253422,
      "originalJapaneseLine": "\t\t今は夜",
      "translatedEnglishLine": "\t\tIt is now night."
    },
    {
      "lineNumber": 253423,
      "originalJapaneseLine": "\t\t夜の森の中、やみくもに進むランス達",
      "translatedEnglishLine": "\t\tRance and the others blindly advance through the night forest."
    },
    {
      "lineNumber": 253424,
      "originalJapaneseLine": "\t\t少し離れた所が使徒メイドが見ている",
      "translatedEnglishLine": "\t\tApostle maids are watching from a little distance."
    },
    {
      "lineNumber": 253425,
      "originalJapaneseLine": "\t\tその頃、ケッセルリンクの屋敷",
      "translatedEnglishLine": "\t\tMeanwhile, at Kesselrink's mansion."
    },
    {
      "lineNumber": 253426,
      "originalJapaneseLine": "\t\t囚われているシィルとシーラは",
      "translatedEnglishLine": "\t\tSiil and Sheila, who are imprisoned,"
    },
    {
      "lineNumber": 253427,
      "originalJapaneseLine": "\t\tメイド達に丁重に扱われていた",
      "translatedEnglishLine": "\t\twere being treated politely by the maids."
    },
    {
      "lineNumber": 253428,
      "originalJapaneseLine": "\t\t夜の森に魔人ケッセルリンクが現れる",
      "translatedEnglishLine": "\t\tThe demon Kesselrink appears in the night forest."
    },
    {
      "lineNumber": 253429,
      "originalJapaneseLine": "\t\t戦闘開始",
      "translatedEnglishLine": "\t\tBattle start."
    },
    {
      "lineNumber": 253430,
      "originalJapaneseLine": "戦闘中　割り込みイベント",
      "translatedEnglishLine": "During battle, an interrupt event."
    },
    {
      "lineNumber": 253431,
      "originalJapaneseLine": "５ターン目、夜のケッセルリンクに苦戦するランス達",
      "translatedEnglishLine": "On the 5th turn, Rance and the others struggle against nighttime Kesselrink."
    }
  ]
}

